    \ **properties):\n    # Set Form properties and Data Bindings.\n    self.init_components(**properties)\n\
    \n    # Any code you write here will run when the form opens.\n\n  def check_click(self,\
    \ **event_args):  \n    \n    self.result_label.visible = True\n    \n    result,\
    \ proba = anvil.server.call('check', self.text_box_1.text)\n    \n    if result\
    \ == 0:\n        self.result_label.text = \"NOT CLICKBAIT\"\n    elif result ==\
    \ 1:\n        self.result_label.text = \"CLICKBAIT\"\n    else:\n    \tself.result_label.text\
    \ = \"ERROR\"\n    \n    RoundNumber = round(proba[0][1]*100, 4)\n    js.call('changeClickbait',\
